	(376, 'Agricolae Ingeniería', '', ' Realizamos proyectos de granjas completas, almacenes agroganaderos, cuartos de aperos, industrias de transformacion, riegos, etc.Legalización de instalaciones ganaderas y agricolas, realizando todos los trámites necesarios.Anteproyectos para la obtención de calificaciones territoriales y licencias municipales de obras, realizando todos los trámites necesarios para la obtencion de los permisos.Direcciones de obra.Mediciones de terrenos,rústicos o urbanos.Informes agrícolas.Valoraciones o tasaciones de fincas rústicas, explotaciones ganaderas o agrícolas.Asesoramiento y gestión de subvenciones tanto del Gobierno Autonómico como del Excmo.Cabildo Insular.Garantizamos la ejecución rápida de los trabajos.Cuando se trate de trámites para la obtencion de algún permiso se realizará desde el primer papel hasta el último, sin que el cliente tenga que realizar ningún trámite.', 'Atlantida 16', '38710', 2, '922437936', '922 43 79 36', '659430343', 'agringenieria@telefonica.net ', '', 'S/C Tenerife', 155, 1, 1328887497, 1328887497, 1, '28.6631069,-17.7872283', NULL, NULL, NULL, NULL),
