	(545, 'Agropalma', '', ' Todos los artículos de jardinería necesarios para poder acometer una limpieza y mantenimiento de su jardín: rastrillos, palas, picos, desbrozadoras, cortacéspedes. También le brindamos asesoramiento en todas las áreas del campo, en especial en el área de las energías limpias. Además, es una empresa dedicada a la venta de productos de ferretería de todo tipo, desde taladradoras, pistolas termo fusibles, tornillos, tuercas, escaleras, cerrojos, cajas fuertes, cajas de herramientas etc.', 'C/ Carlos Fco. Lorenzo Navarro', '38760', 7, '922462304', '', '', '', '', 'S/C Tenerife', 112, 1, 1328887497, 1328887497, 1, '28.6570588,-17.9124154', NULL, NULL, NULL, NULL),
