	(2093, 'Agrupación Folklórica Aduares', '', ' Miembros: 48, actividades: música y bailes folklóricos canarios, habaneras, canciones sudamericanas, observaciones: su vestuario es el de gala del municipio de Breña Alta, rondalla: ropa de faena ó campesino de los distintos pueblos de la isla y trajes de manto y saya. Representando antiguos tejidos como la seda, lana, lino, brocado de pañuelos, calzados, rescatados de la época que se conservan.', 'C/ Treinta de Mayo, nº 88', '38710', 2, '922437193', '', '', '', '', 'S/C Tenerife', 194, 1, 1328887497, 1328887497, 1, '28.6619225,-17.7884186', NULL, NULL, NULL, NULL),
