	(372, 'Aguardientes y Licores de La Palma', '', ' Los licores están fabricados en La Palma con frutas y aguardiente de vino exquisito. Sin esencias, sin alcohol atílico. Todo ecológico. Distintas variedades: Licor de Hierbas, Licor de Níspero, Licor de Café, Licor de Tunos Rojos, Licor Aloe Vera y Miel Abejas, Licor de Higos, Licor Naranja, Crema Aguardiente. Todos con propiedades medicinales.', 'Palmasol II, nº 21', '38710', 2, '', '', '630.028.998', 'aguardientesylicoreslapalma@hotmail.es ', '', 'S/C Tenerife', 153, 1, 1328887497, 1328887497, 1, NULL, NULL, NULL, NULL, NULL),
