	(107, 'Albergue Rural de San Antonio', '', ' El albergue se encuentra ubicado en una zona mixta de cultivos y monteverde, junto a una granja experimental en la que se tratan de recuperar las especies ganaderas autóctonas de la isla. La instalación depende del Cabildo Insular y se ubica a poca distancia de la emblemática ermita de San Antonio del Monte. A menos de un kilómetro en línea recta encontramos también el centro de interpretación de los yacimientos arqueológicos de La Zarza y La Zarcita, que figuran entre los más importantes de Canarias. SERVICIOS: Agua potable, electricidad, duchas, aseos, comedor. RÉGIMEN: De pago', 'Cooperativa Andén Verde (Los Guanches, s/n', '38787', 6, '922400444', '', '', '', '', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.7906487,-17.9176312', NULL, NULL, NULL, NULL),
