	(156, 'Alquimia', '', ' Esta empresa nace como una alternativa más , ante la necesidad de que la sociedad ofrezca fórmulas imaginativas, para vivir con el mínimo grado de enfermedad y discapacidad, con una mejor calidad de vida y , cuando ésto no sea posible , ofrecer la atención que cada situación requiere . Nuestro objetivo , es dar respuesta a sus necesidades de atendimiento, no sólo , en el aspecto puramente sanitario , sino también en el social , dando la mayor cobertura posible al usuario directo que percibe nuestras atenciones y a su familia o cuidadores. Escucha a los que necesiten tus cuidados..... ellos te dirán que hacer.', 'C/ Pintado ,12 Bajo', '38700', 12, '922420624', '92242 03 73', '661671746', 'alquimia420624@hotmail.com ', '', 'S/C Tenerife', 99, 1, 1328887497, 1328887497, 1, '28.6816336,-17.7683063', NULL, NULL, NULL, NULL),
	(255, 'Aluminios Barlovento C.B.', '', ' Carpintería de aluminio, en la cual tratamos de dar al cliente una amplia variedad de servicios, como: puertas abatibles y de correr, ventanas de corredera, guillotina y abatibles, mamparas de baño y oficina, cerramiento de balcones y terrazas. Techos de aluminio, metacrilato, macrolon, claraboyas, paneles, puertas de garaje, puertas galvanizadas para trasteros, y en la cual tenemos una amplia gama de colores, como: blanco, marrón, verde, burdeos, negro, plata... Lacados y anodizados y de cristales, normales, stadip, climatic, parsol, reflectasol. Todo esto y mas para que el cliente quede satisfecho y encuentre siempre lo que busca.', 'C/ Travesía Casco Urbano, 24', '38726', 1, '922186230', '922 18 62 30', '686766830/690095994', '', '', 'S/C Tenerife', 25, 1, 1328887497, 1328887497, 1, '28.8283527,-17.805513', NULL, NULL, NULL, NULL),
