	(32, 'Apartamentos Colon', 'http://localhost/lapalma/wp-content/uploads/2012/02/47Lologo_colon.jpg', ' En el Suroeste de la Isla, en el pequeño y acogedor barrio de Los Quemados, se encuentra el Complejo de vacaciones Colón.Allí, los clientes podrán disfrutar de fabulosas vistas panorámicas al mar y a los Volcanes. A las paradisíacas calas de arena negra se puede acceder en coche en 10 minutos y a los comercios y restaurantes de Fuencaliente, en 5 min.', 'Los Quemados, 54', '38740', 5, '922444530', '', '616589206', 'reservas@apartamentoscolon.es', 'http://www.apartamentoscolon.es/', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.4935352,-17.8572401', NULL, NULL, NULL, NULL),
