	(1521, 'Apartamentos Finca Corral de Payo', 'http://localhost/lapalma/wp-content/uploads/2012/02/3115Lologo.jpg', ' Los apartamentos Corral de Payo, en la isla de La Palma, declarada Reserva Mundial de la Biosfera por la UNESCO, se encuentran .en el municipio de Breña Baja, en la zona noreste de la isla de la Palma, zona de aguacateros y viñedos entre otros cultivos. Lugar ideal para el descanso y el contacto con la naturaleza.http://www.fincacorraldepayo.com/', 'La Polvacera s/n', '38712', 3, '637022822', '', '646105489', 'info@fincacorraldepayo.com', 'http://www.fincacorraldepayo.com/', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.6438639,-17.7895304', NULL, NULL, NULL, NULL),
