	(421, 'Apartamentos La Fuente', 'http://localhost/lapalma/wp-content/uploads/2012/02/387Lologo_aptos_la_fuente.jpg', ' Alquiler turístico de apartamentos, viviendas turísticas y casas rurales', 'Pérez de Brito, 49', '38700', 12, '922415636', '922 41 23 03', '-', 'linfo@la-fuente.com', 'http://www.la-fuente.com', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.6858688,-17.762328', NULL, NULL, NULL, NULL),
	(1530, 'Apartamentos La Muralla', 'http://localhost/lapalma/wp-content/uploads/2012/02/2164Lologo_la_muralla.jpg', ' Los apartamentos han sido totalmente reformados recientemente y cuentan con piscina con cascada de masaje y amplias terrazas-solarium privadas orientadas al poniente, con vistas sobre Puerto Naos y el mar.Se trata de apartamentos tipo bungalows adosados y escalonados, con una superficie aproximada de unos 50 m2 más terrazas de entre 20 y 30 m2, diferenciándose dos tipos de apartamentos: Tipo A: apartamento de 1 dormitorio con cama doble y sofá-cama en el salón. Tipo B: apartamento de 2 dormitorios con 1cama doble en el dormitorio principal y 1 cama sencilla en el dormitorio pequeño.', 'Ctra. Puerto Naos, s/n', '38760', 7, '922408300', '922 46 03 84', '669887576', 'apartamentoslamuralla@apartamentoslamuralla.com', 'http://www.apartamentoslamuralla.com/', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.5845134,-17.8998566', NULL, NULL, NULL, NULL),
	(159, 'Apartamentos Lago Azul', 'http://localhost/lapalma/wp-content/uploads/2012/02/800Lologo_aptos_lago_azul.jpg', ' Los Apartamentos Lago Azul están situados en una de las dos áreas turísticas que posee la isla de La Palma, en la zona de Los Cancajos en el municipio de Breña Baja. Estamos constituidos por 75 unidades alojativas de las cuales, 74 están en explotación turística por los mismos propietarios. Esto significa que somos la única pyme en la isla en la que una comunidad de propietarios de apartamentos se dedique, de forma comunitaria, a este tipo de actividad, repercutiendo económicamente no solo a cada uno de ellos sino también, a la isla de La Palma en su conjunto. Además proporciona un número considerado, para nuestras características, de puestos de trabajo.', 'Urbanización San Antonio del Mar s/ n -', '38712', 3, '922434305', '922 43 46 62', '', 'lagoazudireccion@apartamentoslagoazul.com', 'http://www.apartamentoslagoazul.com/', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.6438639,-17.7895304', NULL, NULL, NULL, NULL),
