	(824, 'Asociación Mantay', '', ' Asociación no lucrativa. Mantay La Palma tiene como objetivo fundamental el dar a conocer y buscar financiamiento para la Casa de Acogida Mantay, que alberga, orienta y capacita a madres adolescentes indígenas y a sus hijos/as en estado de riesgo en Cuzco (Perú).', 'Avenida El Puente, nº 33, piso 8 pta 70', '38700', 12, '', '', '618.468.963', 'mantaylapalma@yahoo.es ', '', 'S/C Tenerife', 12, 1, 1328887497, 1328887497, 1, NULL, NULL, NULL, NULL, NULL),
	(780, 'Asociación Niños Especiales de La Palma', 'http://localhost/lapalma/wp-content/uploads/2012/02/2177Lologo_especiales.jpg', ' La Asociación Niños Especiales de La Palma (NEP) nace, en el año 1996, de la iniciativa de un colectivo de padres y madres de la isla de La Palma con hijos e hijas que padecen algún tipo de lesión neurológica o de componente genético que les causa alguna discapacidad psíquica, física y/o sensorial. Nuestro principal propósito es mejorar la calidad de vida de nuestros hijos e hijas, así como de sus familias, haciendo posible que madres, padres, hermanos y hermanas, así como tutores encuentren orientación y apoyo, que sientan que no están solos y solas. (posibilidad de enlace en orientaciones cuando tiene conocimiento que su hijo/a tiene una discapacidad) Trabajamos para buscar más y mejores ayudas terapéuticas, entre estas iniciativas se encuentra la de aunarlas en un único centro, un centro específico donde se den respuesta a las distintas necesidades que presentan estos niños y niñas y, chicos y chicas.', 'Camino Las Piteras, 22', '38760', 7, '922462886', '922 462 886', '', 'NEP-Asociacion@hotmail.com', 'http://www.asociacionnep.org', 'S/C Tenerife', 12, 1, 1328887497, 1328887497, 1, '28.5849863,-17.8819898', NULL, NULL, NULL, NULL),
	(1497, 'Asociación Niños Especiales de La Palma, N.E.P.', '', ' Objetivos: Creación de un centro Especifico que además de llevar a cabo rehabilitación y estimulación a sus usuarios, sirva de sede a esta Asociación, Realizar cualquier tipo de actividad que promueva y fomente la integración y desarrollo de nuestros niños, ya sean ellos los beneficiarios o sus padres (cursos, seminarios, terapias, charlas informativas, fiestas, etc...), Actuar en todo lo relacionado con el desarrollo de las necesidades de los niños con lesiones neurológicas.', 'Camino Las Piteras, 22', '38760', 7, '922462886', '', '636453941', '', '', 'S/C Tenerife', 15, 1, 1328887497, 1328887497, 1, '28.5849863,-17.8819898', NULL, NULL, NULL, NULL),
	(1560, 'Asociación PADISBALTA', '', ' PADISBALTA fue fundada en el año 2002, con el fin de mejorar la calidad de vida de las personas con discapacidad y sus familias, haciendo hincapié en la oferta de servicios de ocio y tiempo libre, debido a la escasez existente en la isla de La Palma. Poco a poco ha ido incrementado servicios, desde respiros y viajes socioculturales, hasta la ayuda a la integración socio-laboral de sus usuarios o la promoción deportiva.', 'Urbanización Los Rosales, nº 11 - Los Cancajos', '38712', 3, '922433500', '922433382', '', 'padisbalta@hotmail.com ', '', 'S/C Tenerife', 12, 1, 1328887497, 1328887497, 1, '28.6488166,-17.7604153', NULL, NULL, NULL, NULL),
