	(1477, 'Asociación Peña Blaugrana Isla Bonita', 'http://localhost/lapalma/wp-content/uploads/2012/02/2557Lopeyablaugrana.jpg', ' La asociación P.B.Isla Bonita,esta formada por aficionados  y socios al F.C. Barcelona. En nuestro local se realizan actividades de ocio,tenemos servicio de Bar, eso si exclusivo para socios de la peña.Hay que hacerse socio ,precio por anual de 70 €. Información por teléfono ó a través de la web.', 'Vizconde del Buen  Paso, s/n, Local 3', '38760', 7, '687679711', '', '687679711', 'información@penyablaugranaislabonita.com', 'http://penyablaugranaislabonita.com', 'S/C Tenerife', 12, 1, 1328887497, 1328887497, 1, '28.5845134,-17.8998566', NULL, NULL, NULL, NULL),
