	(119, 'AstroTour Isla Bonita, S.L.', 'http://localhost/lapalma/wp-content/uploads/2012/02/3037Loastrotour.jpg', ' Vente a disfrutar con nosotros una noche mágica desde los numerosos miradores naturales de los que dispone la isla para este tipo de actividades. Actividades astronómicas didácticas con telescopios, tanto de día como de noche. Cursos de formación. Destacamos por nuestra movilidad. Proyectos para adaptar lugares (casas rurales, bodegas, hoteles...) ideales para la observación del firmamento. Organizamos observaciones públicas, campamentos Astronómicos, talleres y juegos relacionados con la Astronomía. Estamos en la ejecución de proyectos, tales como “El taller del Astrónomo”, “Caminos del Cielo - Sky ways”, “La Palma y sus 14 cielos”, “Sal y Estrellas”… Somos miembros de la Asociación de Turismo Rural “Isla Bonita”.', 'Avda. El Puente 18, B, 3C', '38700', 12, '', '', '607592175', 'info@astrotour.es', 'http://www.astrotour.es/', 'S/C Tenerife', 39, 1, 1328887497, 1328887497, 1, NULL, NULL, NULL, NULL, NULL),
