	(1774, 'Casa Carlota', 'http://localhost/lapalma/wp-content/uploads/2012/02/521Loislabonita.gif', ' Dispersa. Amplias terrazas, rodeada de viñedos. Bonitas vistas al mar y a la montaña. A tan sólo 10 minutos en coche de la playa.Distribución:  Una habitación de matrimonio, Dos habitaciones individuales, Salón-cocina-comedor, Baño con ducha, Terraza . Equipamiento:  Televisión por satélite, calefacción centralizada, posibilidad de conexión a internet, lavadora. Menaje hogar.', 'San José, sn.', '38712', 3, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6438639,-17.7895304', NULL, NULL, NULL, NULL),
	(1174, 'Casa Celeste', 'http://localhost/lapalma/wp-content/uploads/2012/02/112Loislabonita.gif', ' Casa entera de dos plantas. 3 habitaciones dobles, salón con chimenea, cocina-comedor, baño y terraza. Situada en un lugar especialmente vistoso se encuentra esta preciosa casona con patios decorados con plantas autóctonas.', 'Camino La Alameda nº1. Monte', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6164893,-17.7789419', NULL, NULL, NULL, NULL),
	(1573, 'Casa Cha Miquela A', 'http://localhost/lapalma/wp-content/uploads/2012/02/827Loislabonita.gif', ' Casa entera de dos plantas. 1 dormitorio doble. Salón con chimenea y sofá cama. Cocina-comedor. Baño. Cuna. TV. Calefacción central. Terraza con vistas a la montaña. Desde la planta alta se ve el mar. En medio de un Espacio Natural Protegido.', 'Llano Molina, 7. El Granel', '38715', 11, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7374968,-17.7695429', NULL, NULL, NULL, NULL),
	(572, 'Casa Chicho', 'http://localhost/lapalma/wp-content/uploads/2012/02/808Locasa_chicho.jpg', ' Ofrecemos todo tipo de piensos en general y en especial para palomas y pájaros. Una gama de accesorios de Acuariofilia, (motores, plantas etc).Artículos de Ferretería, para el hogar (aseo, limpieza, utensilios), equipamiento en calzado para trabajo, e insecticidas para las plantas.', 'Carretera a Puerto Naos, La Laguna', '38760', 7, '922460716', '', '', NULL, 'http://www.casachicho.com/', 'S/C Tenerife', 38, 1, 1328887497, 1328887497, 1, '28.6244513,-17.9066992', NULL, NULL, NULL, NULL),
	(871, 'Casa Claudio', 'http://localhost/lapalma/wp-content/uploads/2012/02/3295Loislabonita.jpg', ' Casa Claudio es una casa de dos plantas de algo más de un siglo de antigüedad. En la parte alta se encuentra el salón con suelo y techo de madera, la cocina-comedor, el baño y un amplio corredor con cristaleras. La planta baja la ocupa el dormitorio doble. Casa Claudio cuenta con una terraza que mira hacia el mar, desde la que, en los días despejados, se pueden contemplar las islas de Tenerife y La Gomera.', 'La Sabina', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5851765,-17.7832372', NULL, NULL, NULL, NULL),
	(1614, 'Casa de Buceo', 'http://localhost/lapalma/wp-content/uploads/2012/02/3046Locasadebuceo.jpg', ' Centro de buceo y buceo con tubo, todos los niveles, cursos y inmersiones, grupos pequeñas, salidas diarias. Vendemos equipo de buceo.', 'calvo sotelo 16b', '38760', 7, '922464886', '', '663326520', 'info@casadebuceo.com', 'http://www.casadebuceo.com', 'S/C Tenerife', 2, 1, 1328887497, 1328887497, 1, '28.6588663,-17.9113031', NULL, NULL, NULL, NULL),
	(2026, 'Casa del Artesano', '', ' Comparte estructura con la Casa del Artesano, ubicados en una casa de más de cien años, y lugar donde recibía a sus pacientes el antiguo practicante del pueblo , D. Nicolás Cabezola Perera. Inaugurado el día 18 de junio de 2005, el Centro se encuentra justo en la trasera de la Iglesia de San Miguel, la primera en edificarse en la isla de La Palma, en 1492. En la Casa del Artesano se pueden adquirir productos manufacturados cuya elaboración ha sido llevada a cabo por artesanos del Municipio, aunque en breve expondremos productos de artesanía de municipios cercanos. El horario de apertura en invierno es de 09:30 a 13:00 h. y de 14:30 a 18:30 h. de lunes a viernes (en verano, de 15:30 a 19:30 h.)', ' c/ Isidro Guadalupe, nº 2', '38770', 13, '922480151', '922 48 01 51 ', '', '', '', 'S/C Tenerife', 79, 1, 1328887497, 1328887497, 1, '28.6443761,-17.9327985', NULL, NULL, NULL, NULL),
	(706, 'Casa del Maestro', '', ' Información turismo, exposición y venta de artesanía. Documentación Fiesta del Diablo, historia del municipio, etc..', 'C/ Diesiocho de Julio 11', '38780', 14, '922490003/922490331', '', '', '', '', 'S/C Tenerife', 79, 1, 1328887497, 1328887497, 1, '28.7106504,-17.9553098', NULL, NULL, NULL, NULL),
	(585, 'Casa Díaz', 'http://localhost/lapalma/wp-content/uploads/2012/02/69Loislabonita.gif', ' Casa entera de 2 plantas. 1 habitación doble, cocina, comedor, salón, baño y terrazas. En el exterior, las empedradas terrazas nos ofrecen unas espléndidas vistas de las recortadas y jóvenes costas de Fuencaliente.', 'Los Quemados s/n', '38740', 5, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5135427,-17.8406158', NULL, NULL, NULL, NULL),
	(2177, 'Casa Dos Aguas', 'http://localhost/lapalma/wp-content/uploads/2012/02/121Loislabonita.gif', ' Casa entera. 1 habitación doble, salón-comedor con sofá-cama, cocina, baño con ducha. Amplias terrazas. Jardines. Huertos. Bonitas vistas al mar y a la montaña.En la zona eminentemente agrícola de Malpaíses, se ubica esta casita rural. Encontrándose también muy cerca de uno de nuestros mayores referentes históricos como son los grabados y yacimientos aborígenes del Parque Arqueológico de Belmaco. Rodeada de huertas y jardines, su espaciosa terraza nos ofrece unas vistas maravillosas a la costa donde apreciamos en todo su esplendor el azul intenso del océano. Todos los techos son de madera y los muebles han sido especialmente diseñados, para que se integren perfectamente con los ya existentes en tiempos pasados en esta vivienda de notable antigüedad. La barbacoa se convierte en un rincón especial donde pasaremos agradables momentos junto a nuestros amigos o familiares.', 'C/ Malpaís de Abajo s/n', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5780153,-17.8228459', NULL, NULL, NULL, NULL),
