	(2121, 'Casa La Higuerita', 'http://localhost/lapalma/wp-content/uploads/2012/02/64Loislabonita.gif', ' Casa entera. 1 habitación doble, 1 habitación de matrimonio, sala de estar con sofá-cama y estufa de leña, cocina-comedor, terraza con barbacoa, jardines. Reciclaje y aprovechamiento de aguas residuales y energía fotovoltaica y térmica. Preciosas vistas.', 'C/ La Rosa, 64', '38750', 4, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6576506,-17.8615096', NULL, NULL, NULL, NULL),
	(226, 'Casa La Huerta I', 'http://localhost/lapalma/wp-content/uploads/2012/02/2864Lola_huerta.jpg', ' La casa Huerta I es una vivienda de 65 m2 situada en el barrio de Las Indias (municipio de Fuencaliente de La Palma),lugar caracterizado por un microclima cálido y apacible, ideal para unas vacaciones tranquilas en contacto con la naturaleza. Las vistas desde la terraza son espléndidas: El mar, puesta de sol, monte de pino canario, viñedos, plataneras… Dispone de cocina completamente equipada, salón comedor con televisión vía satélite y equipo de música, baño (secador), dos habitaciones dobles: una de ellas con camas de 2x0,90 y la otra con camas de 1,90x0,80, plancha y mesa de planchado y radiador eléctrico. En el exterior una amplia terraza (mesa y sillas de teka, sombrilla, tumbonas) con una pequeña pérgola, todo ello bordeado por jardines y una huerta de naranjos. También posee un cuarto con lavadora y una pequeña barbacoa. Tenemos cuna a disposición. Admitimos animales (dueño/as responsables). Enclavada en un asentamiento rural a 10 minutos de la playa (en coche), a 100 metros de supermercado y teléfono, a 200 metros de restaurante y a 3 kilómetros del casco urbano donde Vd. encontrará: centro médico de la zona, farmacia, bancos, comercios y otros servicios de interés. Acceso asfaltado y señalizado.', 'Las Indias', '38749', 5, '922444189', '922444189', '680445413', 'carmenhrnandez@hotmail.com', 'http://www.turismorural.de/', 'S/C Tenerife', 107, 1, 1328887497, 1328887497, 1, '28.5031545,-17.8576487', NULL, NULL, NULL, NULL),
	(1092, 'Casa La Huerta II', 'http://localhost/lapalma/wp-content/uploads/2012/02/2865Lola_huerta.jpg', ' La casa Huerta II es una vivienda de 80 m2 situada cerca de Huerta I, en Fuencaliente (sur de la isla), concretamente en Las Indias, lugar caracterizado por un microclima cálido y apacible, ideal para unas vacaciones tranquilas disfrutando de la naturaleza. Las vistas desde la terraza son espléndidas: El mar, puesta de sol, monte de pino canario, viñedos, plataneras… Consta de un amplio salón-comedor-cocina completamente equipados con TV vía satélite, equipo de música, chimenea de leña, dos habitaciones dobles una de ellas con camas de 2x0,90 metros y la otra camas de 1,90x0,90 metros, ambas con armarios empotrados y radiadores eléctricos, baño amplio con secador . Dispone de plancha y mesa de planchado. En el exterior, una amplia terraza cubierta por una pérgola con orientación oeste, posee mesa y sillas de teka, así como tumbonas colocadas tanto en esta terraza como en un patio descubierto situado en la entrada de la casa con orientación este. Todo ello rodeado de huertas con variedad de árboles frutales, en una de las huertas, se encuentra una pequeña barbacoa. Enclavada en un asentamiento rural a 10 minutos de la playa (en coche) a 100 metros de supermercado y teléfono, a 200 metros de restaurante y a 3 kilómetros del casco urbano donde Vd. encontrará: centro médico de la zona, farmacia, bancos, comercios y otros servicios de interés. Acceso asfaltado y señalizado. Cuna a disposición de los clientes.', 'Las Indias', '38749', 5, '922444189', '922444189', '680445413', 'carmenhrnandez@hotmail.com', 'http://www.turismorural.de/', 'S/C Tenerife', 107, 1, 1328887497, 1328887497, 1, '28.5031545,-17.8576487', NULL, NULL, NULL, NULL),
