	(1674, 'Casa las Tierras Viejas', '', ' Casa antigua, restaurada con fondos del programa LeaderI, en el año 1995.casa  familiar situada en una finca agricola de 10.000 metros cuadrados.Situada a 2km del nucleo urbano de Tijarafe. La casa consta de dos dormitorios, un salon, baño, cocina, solana, terraza cubierta, unos amplios patios y jardines de flores. Rodeada de huertos , algunos cultivados de hortalizas, papas, muchos almendros, tuneras y frutales. Situada en zona de medianias, tiene unas hermosas vistas hacia el mar y la montaña.', 'Camino Real N° 51 Las Tierras Viejas Tijarafe', '38780', 14, '922490246', '', '606434731', 'tierras_viejas@hotmail.com', 'www.la-palma-turismo-rural.de', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.669843,-17.940517', NULL, NULL, NULL, NULL),
