	(1645, 'Casa Margarita', 'http://localhost/lapalma/wp-content/uploads/2012/02/105Loislabonita.gif', ' Casa entera. 2 habitaciones dobles, salón-cocina-comedor con sofá-cama, baño y terraza. En medio de un ambiente apacible y sosegado, donde se respira el aroma del pinar, se oye el lenguaje de las grajas y se admiran los encendidos atardeceres.', 'Cueva de Agua', '38787', 6, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.831103,-17.9452502', NULL, NULL, NULL, NULL),
	(1309, 'Casa Massieu', '', ' Exposición y Venta de Artesanía.', 'Plaza de Soto Mayor, 31', '38760', 7, '922401899', '', '', '', '', 'S/C Tenerife', 59, 1, 1328887497, 1328887497, 1, '28.5845134,-17.8998566', NULL, NULL, NULL, NULL),
	(504, 'Casa Maximina', 'http://localhost/lapalma/wp-content/uploads/2012/02/3313Lo56Loislabonita.gif', ' Esta casita fue rehabilitada en el año 2000 y acondicionada para turismo rural, respetando la arquitectura tradicional canaria, con abundante presencia de madera, sobre todo en los techos, y que junto con la luz natural que está presente en cada ambiente a través de las numerosas ventanas, hacen de Casa Maximina un lugar muy acogedor y confortable. Dispone de cocina-comedor con sofá-cama, baño con ducha, cuarto de lavadora y plancha, y una habitación doble con salida directa a una amplia terraza. Dicha terraza está completamente equipada con tumbonas, mesa, sillas, sombrilla, etc., para que pueda disfrutar de unos momentos de relax mientras contempla la salida del sol cada mañana. Cuando el tiempo lo permite, desde la casa hay una magnífica vista de las islas de Tenerife, La Gomera y El Hierro sobre el mar que baña la costa sureste de La Palma.Esta casa tiene barbacoa cubierta y parking propio.', 'Las Caletas', '38740', 5, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.4985408,-17.8250295', NULL, NULL, NULL, NULL),
	(902, 'Casa Medel', 'http://localhost/lapalma/wp-content/uploads/2012/02/2280Loislabonita.gif', ' Esta vivienda de principios de S. XX supone un ejemplo magnifico de la arquitedtura de la época puesto que ha sido rehabilitada respetando su tipología original, manteniendo paredes de piedra, techos de tea, tejados a dos aguas, etc. así como, elementos decorativos que pertenecieron a la familia, este es el caso, de las alacenas empotradas y de las cajas de tea, que en su momento sirvieron de despensa a frutos secos y cereales. Casa Mendel cuenta con dos acogedoras habitaciones y un amplio salón-cocina-comedor, completamente equipadas, lo que unido a la exquisita decoración confiere al espacio de gran calidez. En el exterior, la piedra ha sido la gran protagonistaen la restauración de las amplias y luminosas terrazas que rodean la casa y cercan la variedad de flores y árboles frutales que conforman el jardín.', 'Carretera de la Costa Km. 1.4. La Punta', '38780', 14, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.ecoturismocanarias.com/lapalma/es/CasaForm.asp?Cod=197&isla=4&mo', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6749387,-17.9447825', NULL, NULL, NULL, NULL),
	(851, 'Casa Mona', '', ' Casa Mona: Casa grandiosa Turismo Rural cerca de Santo Domingo con 2 Dormitorios, gran salón con SAT-TV, HiFi, teléfono, acceso a internet y mucho confort!', 'La Piedra km 3', '38787', 6, '922695088', '', '647955707', 'ecocasa@lapalma1.de', 'http://j.mp/qahCbO', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7906487,-17.9176312', NULL, NULL, NULL, NULL),
	(1333, 'Casa Museo del Vino Las Manchas', 'http://localhost/lapalma/wp-content/uploads/2012/02/2538LoMuseoVinoLASMANCHAS.jpg', ' Museo del vino y artesanía.<br>Horario de verano: Lunes a viernes de 9:30 a 13:00 y de 16:00 a 18:00 horas. Sábados de 9:00 a 14:00 horas.<br>Horario habitual: Lunes a viernes de 9:30 a 13:30 y de 16:00 a 18:30. Sábados de 9:30 a 14:00 horas.', 'Cmno. El Callejón, 98 Las Manchas de Abajo', '38760', 7, '922494320', '922 49 43 20', '646773140', '', '', 'S/C Tenerife', 79, 1, 1328887497, 1328887497, 1, '28.5845134,-17.8998566', NULL, NULL, NULL, NULL),
	(2006, 'Casa Panchito', '', ' Titular: Ayuntamiento de Breña Alta, programa: dos salas polivalentes, un local de administración y un local en el altillo con dos aseos, m y f. y otro adaptado. Una plaza que bordea el edificio con fuente y aljibe desde donde se accede al edificio. Superficie: útil 167,43 , construida 222.36, accesos: desde la calle la Constitución por unas escaleras se llega a la plaza, desde la calle Atlántida y a nivel se accede a la plaza. Aparcamientos: no, Iluminación: la interior cumple la iluminación necesaria para su destino, la exterior cumple con la normativa de los Astrofísicos de Canarias, uso principal: social y cultural (exposiciones, reuniones, talleres, etc), fecha de restauración: 2000', 'C/ Atlántida, 1', '38710', 2, '922437009', '922 43 75 97 ', '', '', '', 'S/C Tenerife', 250, 1, 1328887497, 1328887497, 1, '28.6631069,-17.7872283', NULL, NULL, NULL, NULL),
	(903, 'Casa Pantana', 'http://localhost/lapalma/wp-content/uploads/2012/02/2868Loelgallo.jpg', ' Casa Pantana cuenta con cocina, salón-comedor, terraza, dos habitaciones, sofá-cama, un baño, lavadora, radio, tumbonas, solarium,  una pequeña barbacoa y un gran espacio ajardinado.El espacio interior de la Pantana es acogedor, en ella abunda la madera. La Pantana ofrece calidad en sus servicios y descanso en un ambiente tranquilo y rodeado de  naturaleza.', '  C/Pastelero Nº89. Todoque', '38760', 7, '922462141', '922 46 21 41', '629551787', 'fincaelgallo@gmail.com', 'http://www.fincaelgallo.com/ http://www.facebook.com/home.php', 'S/C Tenerife', 107, 1, 1328887497, 1328887497, 1, '28.616662,-17.9027486', NULL, NULL, NULL, NULL),
	(93, 'Casa Pareditas', '', ' Casa Turismo Rural, dos dormitorios, vista al mar, jardín guapo, dentro la naturaleza', 'Camino el Pinar N° 65 Jesus Tijarafe', '38780', 14, '922490522', '922 49 05 22', '699721259', NULL, 'http://www.la-palma-turismo-rural.de/la-palma/tijarafe/tijarafe/casa-las-pareditas.html', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.669843,-17.940517', NULL, NULL, NULL, NULL),
	(1376, 'Casa Peluquina', 'http://localhost/lapalma/wp-content/uploads/2012/02/55Loislabonita.gif', ' Casa entera. 2 habitaciones dobles, salón-recibidor, chimenea, cocina-comedor, baño, antena parabólica y jardines. Casa tranquila con buenas vistas.Informal y sin pretensiones, de techos bajos de madera sin elaborados detalles arquitectónicos, se nos erige la estancia Peluquina. A modo de vestíbulo, el pequeño porche nos recibe y nos invita a hacer vida en los exteriores de la vivienda, rodeada de zonas ajardinadas y espaciosa terraza provista de barbacoa. Las panorámicas que desde ella se avistan tienen un sabor añejo: el mar, los terrenos cultivados y el camino Real que pasa junto a la casa que comunicaba esta zona con el pueblo aledaño de Los Sauces. Esta morada rural dotada de todas las comodidades necesarias es una opción atractiva para todo tipo de usuarios.', 'Lomo de la Florida nº22. Las C', '38726', 1, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.8099877,-17.8169229', NULL, NULL, NULL, NULL),
	(1754, 'Casa Pestana', 'http://localhost/lapalma/wp-content/uploads/2012/02/70Loislabonita.gif', ' Casa entera. 2 habitaciones dobles, salón, comedor, cocina, baño y terraza. Junto al Volcán de San Antonio en su exterior podremos respirar la tranquilidad del lugar en sus terrazas y jardines.', 'C/ La Calle nº8, Los Canarios', '38740', 5, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.4933622,-17.8434126', NULL, NULL, NULL, NULL),
	(1504, 'Casa Platero', '', ' Casa Platero, una casa antigua restaurada del turismo rural en un entorno único: cerca del mar en total tranquilidad, lejos de la civilización. Funciona con energía solar de abundancia, 2 dormitorios, salón con SAT-TV, HiFi, acceso a internet con Garafía Virtual, barbacoa, terraza con vista al mar, estupenda, con burros, caballos, situada en un parque natural privada de más de 30 hectáreas. No hay nada parecido!', 'Lomada Grande, 34', '38787', 6, '922695088', '-1,80E+12', '647955707', 'ecocasa@lapalma.info', 'http://j.mp/pVHRT7', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7906487,-17.9176312', NULL, NULL, NULL, NULL),
	(1569, 'Casa Priscila', '', ' 1 Habitación doble, cocina comedor, hall con sofá-cama, baño, terraza y frutales. Entorno acogedor y tranquilo. Barbacoa. Casa independiente.', 'Monte de Breña, 117', '38730', 9, '405604488', '405604488', '', 'Turismorural.Pflieger@t-online.de', 'http://www.la-palma-turismo-rural.de/la-palma/mazo-santa-cruz/mazo/casa-priscila.html', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6307456,-17.7720802', NULL, NULL, NULL, NULL),
	(1074, 'Casa Puente Roto', 'http://localhost/lapalma/wp-content/uploads/2012/02/118Loislabonita.gif', ' Casa entera. 2 habitaciones dobles, salón-comedor con sofá cama, estufa de leña, cocina, baño, horno antigüo, barbacoa y terraza. Buenas vistas al mar y a las otras islas.', 'El Puente Roto s/n. Tigalate', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5780153,-17.8228459', NULL, NULL, NULL, NULL),
	(2033, 'Casa Rincón de Mercedes', 'http://localhost/lapalma/wp-content/uploads/2012/02/71Loislabonita.gif', ' Casa entera. 1 Habitación doble. 1 individual. Salón. cocina-comedor. baño. Amplias terrazas. Jardín. Rodeada de huertos. Vistas a la costa de Fuencaliente. (En días despejados se ve Tenerife y La Gomera). Aljibe rehabilitada y acondicionada como terraza.', 'Pista el Somadero, 2', '38740', 5, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5004986,-17.8262808', NULL, NULL, NULL, NULL),
