	(1264, 'Casa Rural Los Volcanes', '', ' Esta situada en la zona de Tigalate (Mazo con vistas al mar y a la montaña, en un lugar muy tranquilo, dispone de terraza jardinada con arboles frutales, cama de matrimonio, TV, calefación eléctrica y chimenea, etc', 'Camino de Tigalate', '38730', 9, '922444164', '922 44 41 64', '696648904', 'apartamentoslosvolcanes@hotmail.com', 'http://www.la-palma-turismo-rural.de/la-palma/mazo-santa-cruz/mazo/casa-los-volcanes.html', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5547744,-17.7997248', NULL, NULL, NULL, NULL),
	(829, 'Casa Salazar', 'http://localhost/lapalma/wp-content/uploads/2012/02/113Loislabonita.gif', ' Casa entera de dos plantas.4 Habitaciones dobles con baño, cocina-comedor, salón, sala de lectura, baño y terrazas. Lavadora. Entre viñedos. Junto a taller de artesanía (cerámica) de la propietaria.', 'La Crucita s/n. Monte Breña', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5780153,-17.8228459', NULL, NULL, NULL, NULL),
	(183, 'Casa San Sebastián: Yaiza', 'http://localhost/lapalma/wp-content/uploads/2012/02/90Loislabonita.gif', ' Casa entera . 1 Habitación, cocina-comedor, salón, baño. Conexión a internet. Entrada compartida con otras dos viviendas “Lolina” y “Abidán”. Vistas a la calle San Sebastián. La primera casa rural situada en el casco histórico de Santa Cruz de La Palma.', 'C/.San Sebastián, nº28', '38700', 12, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7165795,-17.7991545', NULL, NULL, NULL, NULL),
	(1258, 'Casa Santiago', 'http://localhost/lapalma/wp-content/uploads/2012/02/68Loislabonita.gif', ' Casa entera. 1 habitación doble, cocina-comedor, cuarto de estar, salón baño y terraza con porche y barbacoa. Al exterior podemos disfrutar de unas amplias vistas hacia las recortadas costas del sur de la Isla.', 'C/ Pista del Somadero nº4, Las', '38740', 5, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5135427,-17.8406158', NULL, NULL, NULL, NULL),
	(1125, 'Casa Sitio Madrina', 'http://localhost/lapalma/wp-content/uploads/2012/02/115Loislabonita.gif', ' Casa entera. 1 habitación doble, 1 habitación de matrimonio, salón-comedor con sofá cama y chimenea, cocina, baño, hall, baño exterior y terraza. Barbacoa. Vistas al mar.', 'Los Callejones s/n.', '38730', 9, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.5780153,-17.8228459', NULL, NULL, NULL, NULL),
	(1321, 'Casa Sombrero de Pico A', 'http://localhost/lapalma/wp-content/uploads/2012/02/62Loislabonita.gif', ' Casa entera. 1 Habitación doble, cocina-comedor-sala de estar, baño con ducha. Terraza. Vistas a la Cumbre y al huerto. Teléfono, lavadora y tumbonas de uso común.', 'C/ Sombrero de Pico nº7', '38750', 4, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6618437,-17.8702347', NULL, NULL, NULL, NULL),
	(2120, 'Casa Tomasín', 'http://localhost/lapalma/wp-content/uploads/2012/02/87Loislabonita.gif', ' Casa entera. 2 habitaciones dobles. Cocina-comedor. Salón con chimenea. Baño con bañera. Terraza y barbacoa. Cuna. TV. Situada en zona de medianías y rodeada de huertas. Vistas al mar y a la montaña.', 'Lomo El Tomasín, s/n. El Grane', '38715', 11, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7374968,-17.7695429', NULL, NULL, NULL, NULL),
	(2172, 'Casa Villa Asunción', 'http://localhost/lapalma/wp-content/uploads/2012/02/522Loislabonita.gif', ' Distribución:  1 Habitación doble, Salón-cocina-comedor, Baño con ducha, Terraza, Jardines.Equipamiento:  Piscina de uso compartido con otras dos viviendas. Sofá-cama. Menaje hogar.', 'San José, sn', '38712', 3, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6438639,-17.7895304', NULL, NULL, NULL, NULL),
	(334, 'Casa Villa Martina', 'http://localhost/lapalma/wp-content/uploads/2012/02/79Loislabonita.gif', ' Casa entera. 2 habitaciones dobles 1 habitación individual, recibidor, cocina-comedor, baño, terraza y jardines. Estufa de leña. Situada entre pinares y con buenas vistas.', 'Fátima nº 6, Fagundo', '38789', 10, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7605961,-17.9757334', NULL, NULL, NULL, NULL),
	(525, 'Casa Vistamar', 'http://localhost/lapalma/wp-content/uploads/2012/02/2867Loelgallo.jpg', ' Vistamar cuenta con cocina, salón-comedor, terraza, dos habitaciones, sofá-cama, un baño, lavadora, radio, tumbonas, solarium, barbacoa y un gran espacio ajardinado.', 'Camino Las Casitas, 25', '38760', 7, '922462141', '922 46 21 41', '629551787', 'fincaelgallo@gmail.com', 'http://www.fincaelgallo.com http://www.facebook.com/home.php', 'S/C Tenerife', 107, 1, 1328887497, 1328887497, 1, '28.6345368,-17.9093341', NULL, NULL, NULL, NULL),
	(446, 'Casas Rurales Finca Corral de Payo', 'http://localhost/lapalma/wp-content/uploads/2012/02/3116Lologo.jpg', ' El complejo consta de los Apartamentos disponen de un total de 6 viviendas repartidas en dos plantas y Casa Rural Casa Blanca y Casa Rural El Lagar.Cada apartamentos consta de una habitación doble con armario empotrado de madera, un baño con bañera, salón con sofá cama para una tercera persona y barra americana que lo separa de la cocina que esta completamente equipada., con todo el menaje de hogar.La piscina, que se encuentra delante de los apartamentos y el jardín de plantas y árboles , muchos de ellos típicos del paisaje canario, son compartidos por todos los apartamentos y casas rurales de la finca., así como la zona de tumbonas y paraguas para tomar el sol.', 'La Polvacera s/n', '38712', 3, '', '', '(0034)637022822', 'info@fincacorraldepayo.com', 'http://www.fincacorraldepayo.com/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.6438639,-17.7895304', NULL, NULL, NULL, NULL),
	(442, 'Casona La Galga', 'http://localhost/lapalma/wp-content/uploads/2012/02/85Loislabonita.gif', ' Casa entera. 6 habitaciones dobles, comedor, salón de 61 m2, sala recepción ,solarium, 2 baños, cocina con horno, cuarto trastero, terraza y jardines. Chimenea. Buenas vistas y cerca del paraje natural del Cubo de La Galga.', 'Lomo Piñero 12. La Galga', '38715', 11, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7625491,-17.7639362', NULL, NULL, NULL, NULL),
