	(1951, 'El Pino La Virgen', '', ' Está especializado en cocina tradicional canaria. Sus tapas van desde las conocidas papas arrugadas con mojo picón que se sirven acompañadas de un mojo elaborado con almendras, pimientos morrones y sin picante, hasta los mejillones con salsa de azafrán. Muy buenas las cazuelas de garbanzos compuestos o de pollo en salmorejo.   Situado en Puntagorda, Pino de la Virgen como Restaurante, está dedicado a la cocina Tradicional Canaria. Acudiendo a viejas recetas de la familia, se elaboran platos del Hierro, Lanzarote y Tenerife. Otros platos de la comida popular de las Islas son el fruto de años que su propietario, ha dedicado a la cocina y a la investigación gastronómica.', 'El Pino nº 6', '38789', 10, '922.49.32.28', '', '', '', '', 'S/C Tenerife', 6, 1, 1328887497, 1328887497, 1, '28.7663679,-17.9785419', NULL, NULL, NULL, NULL),
