	(294, 'Finca Experimental El Sitio', 'http://localhost/lapalma/wp-content/uploads/2012/02/2304Lologo_finca_el_sitio.jpg', ' En la finca Tabaqura el Sitio, no sólo se desarrolla el cultivo de la planta, además los procesos de secado y fermentación, dan paso a una esmerada elaboración de cigarros puros, que invitan a sus consumidores a paladar la historia del tabaco Palmero.Por tanto, tradición y un delicado entorno, hacen de la finca Tabaquera el Sitio, uno de los rincones más importantes y tradicionales del tabaco, en la isla de La Palma.', 'Camino la Cueva, Nº 19, Finca el Sitio', '38710', 2, '()922435227', '() 922 435 227', '', 'info@fincatabaqueraelsitio.com', 'http://www.fincatabaqueraelsitio.com', 'S/C Tenerife', 134, 1, 1328887497, 1328887497, 1, '28.659051,-17.791189', NULL, NULL, NULL, NULL),
