	(1711, 'Hotel Sol La Palma', 'http://localhost/lapalma/wp-content/uploads/2012/02/2165Lologo_hotelsol.jpg', ' Gran complejo formado por un hotel de 4 estrellas y 3 edificios de apartamentos, en primera línea de mar, sobre la tranquila playa de Puerto Naos y en mitad de una exótica plantación de plataneras. Queda a 8 km de Los Llanos de Aridane y a 35 km del aeropuerto y de Santa Cruz de la Palma. Construido e inaugurado en 1990.', 'Puerto Naos  La Palma', '38769', 7, '922408000', '922 40 80 14', '', 'ol.la.palma@solmelia.com', 'http://www.solmelia.com/solNew/reservations/jsp/C_Search_Availability.jsp', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.5863934,-17.9096791', NULL, NULL, NULL, NULL),
	(200, 'Hotel Taburiente Playa', 'http://localhost/lapalma/wp-content/uploads/2012/02/1827Lo1827Lologo_taburiente_playa.jpg', ' l H10 Taburiente Playa se encuentra situado en primera línea de mar en la frondosa isla de La Palma, conocida por sus bellos paisajes y exótica naturaleza. Junto al H10 Costa Salinas, la Playa de los Cancajos dista sólo 300 m del hotel. Su variada oferta culinaria, sus completas instalaciones deportivas que incluyen piscinas, pista de tenis y minigolf, sus 3 salones de convenciones, así como su localización lo convierten en el hotel ideal para una visita a La Palma ya sea por negocios o placer.283 habitaciones9 SuitesTV SatéliteCaja fuerteMinibarBalcónLobby barSnack Bar en zona piscinaRestaurante Taburiente con buffet y cocina en vivoBar Salon con música en vivo2 piscinas de adultos (1 climatizada en invierno)1 Piscina infantil1 Pista de TenisMinigolfSauna y MasajeParque InfantilMiniclub Daisy (verano)Internet Corner', 'Urb. Las Salinas, Playa de los Cancajos', '38712', 3, '922181277', ' 922 18 12 85', '', 'h10.taburiente.playa@h10.es', 'http://www.h10hotels.com', 'S/C Tenerife', 75, 1, 1328887497, 1328887497, 1, '28.6488166,-17.7604153', NULL, NULL, NULL, NULL),
