	(1984, 'Mecanizados San Antonio', '', ' Empresa fundada en 1980. Reparaciones mecánicas e industriales. Torno, fresa, plegadora, cizalla. Curvadora de tubo con mandril. Torno portátil para mandrinar y recargo de soldadura automática sobre agujeros pasantes. Puente grua 5 TM. Soldadura en general tubos de escape y silenciosos. Mangueras hidráulicas alta, media y baja presión. Barandas de tubo inx. para 4x4 cajones de aluminio. Mataburros defensas, montajes de bola de remolque. Vastagos, tubos de botellas hidráulicas y tansmisiones. Cables galvanizados y antitorción. Estigas de cable y poliester. Ganchos normales y seguridad de alta resistencia. Tornillería en inx. y acero 10.9 y 12.9. Rodamientos soportes SKF-FAG piñones para cadenas. Los trabajos fáciles también los hacemos.', 'C/. San Antonio, Nº 147', '38711', 3, '922434379', '922 43 58 39', '', 'mecanizadossa@terra.es ', '', 'S/C Tenerife', 81, 1, 1328887497, 1328887497, 1, '28.6471491,-17.7689529', NULL, NULL, NULL, NULL),
