	(253, 'Museo del Plátano', '', ' Junto al cual ya se construye el futuro Museo del Mojo y del Licor de Café, acoge en su planta alta una serie de paneles que recorre todas y cada una de las facetas y aspectos de esta fruta: su historia, el transporte, las plagas, los aspectos políticos en cada momento histórico, el proceso de cultivo y maduración, las distintas especies que existen, etc. Junto a ellos podemos ver herramientas y piezas de uso diario en el proceso de producción del cultivo y su recolección. En la planta baja nos encontramos con un salón multiusos que ya ha acogido exposiciones y eventos tales como conferencias y reuniones de trabajo de diferentes colectivos. También posee el Museo del Plátano una pequeña cocina, en la cual se prevé la venta de batidos de plátano y de productos basados en esta fruta tan importante para la historia del pueblo palmero.', 'Casco Histórico de Tazacorte', '38770', 13, '922480151.', '922 48 01 51 ', '', '', '', 'S/C Tenerife', 79, 1, 1328887497, 1328887497, 1, '28.6239916,-17.9205937', NULL, NULL, NULL, NULL),
