	(505, 'Palma Finca', 'http://localhost/lapalma/wp-content/uploads/2012/02/3048LoLOGOTIPO-PALMA-FINCA.jpg', ' Palma Finca Canarias, es una empresa inmobiliaria que lleva ya más de dos década, trabajando en el sector y que se encuentra ubicada en Los Llanos de Aridane, Isla de La Palma, Canarias, España.Dirigida por D. José Carlos Rodríguez Díaz, Gestor Inmobiliario, titulado a tal efecto por la, Escuela Abierta de Estudios Universitarios de Barcelona y por, El Instituto Superior de Estudios de la misma ciudad, ha desarrollado cursos y seminarios de especialización dentro del ámbito de su profesión.Además de hablar correctamente Español, Ingles, Francés y Alemán, puede informarle de todos los pormenores legales y fiscales, que su inversión pueda devengar en nuestro país, debido a su preparación académica y larga experiencia.Su actividad profesional, más de 25 años de larga trayectoria en el sector, está avalada, por infinidad de operaciones de intermediación que ha realizado en más de 13 Países.Pertenece como miembro de pleno derecho a la Asociación Europea de Gestores y Administradores Inmobiliarios y a la Confederación Europea de la Inmobiliaria, lo que le garantiza, para su tranquilidad y seguridad, el conocimiento de la reciprocidad legal entre los Países de la Unión Europea.Es por eso que le esperamos en nuestras oficinas, para atenderle con total dedicación y defender sus intereses inmobiliarios o de inversión en nuestro país, si lo estima conveniente.Reciba un Cordial Saludo desde las Islas Canarias.José Carlos Rodríguez Díaz', 'Calle Real Nº32 - 38760 Los Llanos de Aridane', '38760', 7, '922402534', '922402505', '618308688', 'palmafinca@infonegocio.com', 'http://www.palmafinca.com', 'S/C Tenerife', 64, 1, 1328887497, 1328887497, 1, '28.5845134,-17.8998566', NULL, NULL, NULL, NULL),
