	(1435, 'Turismo Rural Isla Bonita', 'http://localhost/lapalma/wp-content/uploads/2012/02/128Loislabonita.gif', ' Disfrutar de la naturaleza, la tranquilidad y de las genuinas formas de vida rural, en una casa tradicional rehabilitada es una posibilidad que puede alcanzar de la mano de la Asociación de Turismo Rural Isla Bonita. Turismo Rural Isla Bonita dispone de una oferta de Casas Rurales, en las que la naturaleza empieza prácticamente desde la puerta de la casa y puede ser descubierta a pie, o si lo prefiere en bicicleta o cualquier otro medio.  Nuestras Casas Rurales se pueden alquilar con carácter exclusivo, de uso individual, para familias o grupos, o si lo desea, compartidamente con otros usuarios turísticos. Nuestro compromiso con la calidad lo hemos querido reflejar con el símbolo distintivo que encontrará en la puerta de nuestras Casas Rurales, ofreciéndole un alojamiento confortable, unos principios de mejora de la calidad ambiental, armonía de la casa con el paisaje, trato cordial, atento y directo, a través del propietario/a o prestatario/a del alojamiento y una atención permanente desde nuestra Central de Reservas.  Para todo ello, basta con ponerse en contacto con la Central de Reservas, ya sea a través de teléfono, fax, e-mail, o internet, siempre estaremos encantados de atenderle. Toda una oferta pensada para que usted disfrute, entre nosotros, de Santa Cruz de La Palma, una ciudad que ha sabido cuidar la belleza y señorío del pasado para combinarlos con las ventajas del progreso.', '', '38700', 12, '922430625', '922 43 06 25', '', 'reservas@islabonita.es', 'http://www.islabonita.es/', 'S/C Tenerife', 19, 1, 1328887497, 1328887497, 1, '28.7165795,-17.7991545', NULL, NULL, NULL, NULL),
