	(239, 'Universidad Ambiental de La Palma', 'http://localhost/lapalma/wp-content/uploads/2012/02/2332Lologo_universidadambiental.jpg', ' La Fundación Universidad Ambiental de La Palma es una organización de naturaleza fundacional y sin ánimo de lucro, cuyo patrimonio se destina a la realización de fines de interés general, propios de la Fundación , según el artículo primero de sus Estatutos . La Fundación , una vez constituida ante notario, se encuentra actualmente en trámite de inscripción en el Registro de Fundaciones del Gobierno de Canarias, lo que le conferirá a su término personalidad jurídica propia y capacidad plena para realizar todos aquellos actos que sean necesarios para el cumplimiento de la finalidad para la que ha sido creada, con sujeción a lo establecido en el ordenamiento jurídico vigente y en sus Estatutos, que han sido aprobados por los órganos colegiados de cada una de las Entidades que forman parte de la misma. Fundación Universidad Ambiental de La Palma:Departamento de Educación y Cultura del Cabildo Insular de La Palma, quinta planta del Cabildo Insular, teléfonos 922 42 31 58 y 922 42 33 38 E-mail: serv.cultura@cablapalma.es Vicerrectorado de Extensión Universitaria y Relaciones Institucionales de la Universidad de La Laguna , teléfono 922 31 86 16 (horario de 9,30 a 13,30 horas). Sede de la Organización de los Cursos Casa Principal de Salazar, calle Real, 22', 'Plaza España 1', '38700', 12, '922423158/3338', '', '619381866', 'info@universidadambientaldelapalma.es', 'http://www.universidadambientaldelapalma.es', 'S/C Tenerife', 95, 1, 1328887497, 1328887497, 1, '28.6834176,-17.7646689', NULL, NULL, NULL, NULL),
